import axios from "axios"

/*

The following two are examples of how to send requests using axios:

axios.post("user/login", userObject)
            .then(
                (res) => {
                    console.log(res)
                    console.log(res.data)
                }
            )
            .catch(
                (error) => {
                    console.log(error)
                }
            )

axios.get("delivery/list/dispatcher/all")
            .then(
                (res) => {
                    console.log(res)
                    console.log(res.data)
                }
            )
            .catch(
                (error) => {
                    console.log(error)
                }
            )

 */
